A Celebration of love, life and freedom as seven gay and lesbian comic storytellers share their personal stories of &quot;coming out&quot; to family, friends and co-workers, and living &quot;out&quot; and proud. 
Their insights about gay culture will make you laugh out loud, their experiences of first loves and heartaches will move you to tears and their honesty will inspire you.
